Gói thầu HDDT2024-HATANG2024-LANIT2024-01.TV: Tư vấn khảo sát, lập Báo cáo kinh tế kỹ thuật
- Lô số 01: Tư vấn khảo sát, lập Báo cáo kinh tế kỹ thuật dự án “Đầu tư hạ tầng máy chủ triển khai hóa đơn điện tử”;
